import React from "react";

const Button = ({ type, onClick, onSubmit, label, className }) => {
  return (
    <button
      type={type}
      onClick={onClick}
      onSubmit={onSubmit}
      className={className}
    >
      {label}
    </button>
  );
};

export default Button;
